import React from 'react'
import { NavigationMenu } from '../navigation-menu'
import * as S from './styles'
const Logo = () => {
  return (
    <S.Logo to='/'>
        <S.Text>W.</S.Text>
        <NavigationMenu/>
    </S.Logo>
  )
}

export {Logo}
